INSERT INTO public."MbEvents" (id, title, description, cover_image_url, instructions, start_time, end_time, "createdAt", "updatedAt") VALUES ('88f57ae6-f333-4d2f-8a96-ed35d8b55631', 'Mintbean Hackathons: Hack The Math', 'This hackathon challenge will require you to display information in a visual, digestible format. Code provides an accessible avenue to converting important, complex data into graphics everyone can understand!', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F108235013%2F209335104615%2F1%2Foriginal.20200810-222738?w=1080&auto=format%2Ccompress&q=75&sharp=10&rect=0%2C0%2C6480%2C3240&s=8a9dacdb96bd9cfd65c11adc68a82327', 'TBA', '2020-08-24 11:30:00+00', '2020-08-24 14:00:00+00', '2020-08-19 18:01:27.754+00', '2020-08-19 18:01:27.754+00');
INSERT INTO public."MbEvents" (id, title, description, cover_image_url, instructions, start_time, end_time, "createdAt", "updatedAt") VALUES ('56c3bcbd-2f5c-49b6-a321-38b22064bdbf', 'Mintbean Hackathons: Svelte.js', 'Come try a new approach to building user interface. Unlike frameworks like React or Vue, Svelte.js runs at build time, converting your components into apps that run with excellent performance.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F108620081%2F209335104615%2F1%2Foriginal.20200814-201852?w=1080&auto=format%2Ccompress&q=75&sharp=10&rect=0%2C0%2C2160%2C1080&s=7376a4435dc95cd67c3349c82176fbe2', 'TBA', '2020-08-26 11:00:00+00', '2020-08-26 14:00:00+00', '2020-08-19 18:07:14.341+00', '2020-08-19 18:07:14.341+00');
INSERT INTO public."MbEvents" (id, title, description, cover_image_url, instructions, start_time, end_time, "createdAt", "updatedAt") VALUES ('5818c9ce-3a99-4109-8588-02259b9d3aa1', 'Mintbean Hackathons: Tailwind CSS', 'Utility first. Entirely customizable. Come play with TailwindCSS, low-level CSS framework and see what you can create when you don''t have to fight to override styles.', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F108628473%2F209335104615%2F1%2Foriginal.20200814-221841?w=1080&auto=format%2Ccompress&q=75&sharp=10&rect=0%2C0%2C2160%2C1080&s=50698b47f5cbf7c7c1c2c66867a78443', 'TBA', '2020-08-31 11:30:00+00', '2020-08-31 14:00:00+00', '2020-08-19 18:08:59.943+00', '2020-08-19 18:08:59.943+00');
INSERT INTO public."MbEvents" (id, title, description, cover_image_url, instructions, start_time, end_time, "createdAt", "updatedAt") VALUES ('d1c87f8e-b094-4ab8-ad77-e940ce926244', 'Mintbean Hackathons: Open Hack - No Mouse!', 'No mouse, fully accessible - This is the challenge we pose to you during this hackathon. We want to see how you approach this open concept and get blown us away by your creative ideas!', 'https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F108914031%2F209335104615%2F1%2Foriginal.20200818-214730?w=1080&auto=format%2Ccompress&q=75&sharp=10&rect=0%2C0%2C5200%2C2600&s=f80cb8f06a0c0b5cdb8ed3da88095c95', 'TBA', '2020-09-02 15:30:00+00', '2020-09-02 18:00:00+00', '2020-08-19 18:17:10.227+00', '2020-08-19 18:17:10.227+00');
